"use strict";(self.webpackChunkspanish_prototype=self.webpackChunkspanish_prototype||[]).push([[8055],{8055:e=>{e.exports=JSON.parse('{"lessonId":"A2_U11","title":"\u0423\u0440\u043e\u043a 11: el rojo, uno rojo (\u041e\u043f\u0443\u0449\u0435\u043d\u0438\u0435 \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u0438\u0442\u0435\u043b\u044c\u043d\u043e\u0433\u043e)","level":"A2","components":[{"type":"TheoryBlock","title":"\u0422\u0435\u043e\u0440\u0438\u044f: \u041e\u043f\u0443\u0449\u0435\u043d\u0438\u0435 \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u0438\u0442\u0435\u043b\u044c\u043d\u043e\u0433\u043e \u0441 \u0430\u0440\u0442\u0438\u043a\u043b\u044f\u043c\u0438","content":[{"text":"\u0410\u0440\u0442\u0438\u043a\u043b\u0438 `el, la, los, las` \u0438 `un, una, unos, unas` \u043c\u043e\u0433\u0443\u0442 \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u0442\u044c\u0441\u044f \u0431\u0435\u0437 \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u0438\u0442\u0435\u043b\u044c\u043d\u043e\u0433\u043e, \u043a\u043e\u0433\u0434\u0430 \u0438\u0437 \u043a\u043e\u043d\u0442\u0435\u043a\u0441\u0442\u0430 \u043f\u043e\u043d\u044f\u0442\u043d\u043e, \u043e \u043a\u0430\u043a\u043e\u043c \u043f\u0440\u0435\u0434\u043c\u0435\u0442\u0435 \u0438\u043b\u0438 \u044f\u0432\u043b\u0435\u043d\u0438\u0438 \u0438\u0434\u0435\u0442 \u0440\u0435\u0447\u044c."},{"text":"<strong>`el, la, los, las` + `uno, una, unos, unas` + \u043f\u0440\u0438\u043b\u0430\u0433\u0430\u0442\u0435\u043b\u044c\u043d\u043e\u0435</strong>"},{"list":["\u2013\xbfQu\xe9 camisa te gusta m\xe1s? \u2013<strong>La verde</strong>. (\u0432\u043c\u0435\u0441\u0442\u043e \'la camisa verde\')","\u2013\xbfQu\xe9 tipo de zapatos quiere? \u2013Quiero <strong>unos c\xf3modos</strong>. (\u0432\u043c\u0435\u0441\u0442\u043e \'unos zapatos c\xf3modos\')","\u2013\xbfQui\xe9n es don Tom\xe1s? \u2013<strong>El delgado</strong>. (\u0432\u043c\u0435\u0441\u0442\u043e \'el se\xf1or delgado\')"]},{"text":"<strong>\u0421\u0440\u0430\u0432\u043d\u0438\u0442\u0435 (Compare):</strong>"},{"table":{"headers":["\u041e\u043f\u0440\u0435\u0434\u0435\u043b\u0451\u043d\u043d\u044b\u0439 \u0430\u0440\u0442\u0438\u043a\u043b\u044c","\u041d\u0435\u043e\u043f\u0440\u0435\u0434\u0435\u043b\u0451\u043d\u043d\u044b\u0439 \u0430\u0440\u0442\u0438\u043a\u043b\u044c"],"rows":[["\u0418\u0441\u043f\u043e\u043b\u044c\u0437\u0443\u0435\u0442\u0441\u044f `el, la, los, las`, \u043a\u043e\u0433\u0434\u0430 \u0440\u0435\u0447\u044c \u043e \u0447\u0451\u043c-\u0442\u043e \u043a\u043e\u043d\u043a\u0440\u0435\u0442\u043d\u043e\u043c \u0438\u043b\u0438 \u0441\u043f\u0435\u0446\u0438\u0444\u0438\u0447\u0435\u0441\u043a\u043e\u043c:<br>\u2013\xbfQui\xe9n es Susi? \u2013<strong>La alta</strong>. (\u0442\u0430 \u0441\u0430\u043c\u0430\u044f \u0432\u044b\u0441\u043e\u043a\u0430\u044f \u0434\u0435\u0432\u0443\u0448\u043a\u0430)","\u0418\u0441\u043f\u043e\u043b\u044c\u0437\u0443\u0435\u0442\u0441\u044f `un, una, unos, unas`, \u043a\u043e\u0433\u0434\u0430 \u0440\u0435\u0447\u044c \u043e \u043a\u043b\u0430\u0441\u0441\u0435 \u0438\u043b\u0438 \u0442\u0438\u043f\u0435 \u043e\u0431\u044a\u0435\u043a\u0442\u043e\u0432:<br>\u2013\xbfQu\xe9 tipo de coche busca? \u2013<strong>Uno peque\xf1o</strong>. (\u043a\u0430\u043a\u043e\u0439-\u043d\u0438\u0431\u0443\u0434\u044c \u043c\u0430\u043b\u0435\u043d\u044c\u043a\u0438\u0439 \u0430\u0432\u0442\u043e\u043c\u043e\u0431\u0438\u043b\u044c)"]]}},{"text":"<strong>\u0412\u041d\u0418\u041c\u0410\u041d\u0418\u0415 (ATENCI\xd3N):</strong><br>\u0424\u043e\u0440\u043c\u0430 \u043f\u0440\u0438\u043b\u0430\u0433\u0430\u0442\u0435\u043b\u044c\u043d\u043e\u0433\u043e (\u043c\u0443\u0436\u0441\u043a\u043e\u0439, \u0436\u0435\u043d\u0441\u043a\u0438\u0439, \u0435\u0434.\u0447. \u0438\u043b\u0438 \u043c\u043d.\u0447.) \u0434\u043e\u043b\u0436\u043d\u0430 \u0441\u043e\u0432\u043f\u0430\u0434\u0430\u0442\u044c \u0441 \u0444\u043e\u0440\u043c\u043e\u0439 \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u0438\u0442\u0435\u043b\u044c\u043d\u043e\u0433\u043e, \u043a\u043e\u0442\u043e\u0440\u043e\u0435 \u043e\u043d\u043e \u0437\u0430\u043c\u0435\u043d\u044f\u0435\u0442.<br><i>\u2013\xbfQu\xe9 zapatillas te gustan m\xe1s? \u2013<strong>Las rojas</strong>.</i>"}]},{"type":"TheoryBlock","title":"\u0422\u0435\u043e\u0440\u0438\u044f: \u0414\u0440\u0443\u0433\u0438\u0435 \u043a\u043e\u043d\u0441\u0442\u0440\u0443\u043a\u0446\u0438\u0438 \u0434\u043b\u044f \u043e\u043f\u0443\u0449\u0435\u043d\u0438\u044f \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u0438\u0442\u0435\u043b\u044c\u043d\u043e\u0433\u043e","content":[{"text":"<strong>1. `el, la, los, las` + `de` + \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u0438\u0442\u0435\u043b\u044c\u043d\u043e\u0435 = \u0432\u043b\u0430\u0434\u0435\u043d\u0438\u0435, \u0441\u0438\u0442\u0443\u0430\u0446\u0438\u044f, \u043c\u0430\u0442\u0435\u0440\u0438\u0430\u043b</strong>"},{"list":["Mi coche es peor que <strong>el de</strong> mi hermano. (= el coche de mi hermano)","\u2013\xbfQui\xe9n es Alicia? \u2013<strong>La del</strong> vestido blanco. (= la chica del vestido blanco)","Esas gafas no me gustan. Prefiero <strong>las de</strong> la derecha. (= las gafas de la derecha)","\u2013\xbfQu\xe9 pendientes te vas a poner? \u2013<strong>Los de</strong> oro. (= los pendientes de oro)"]},{"text":"<strong>2. `lo` + \u043f\u0440\u0438\u043b\u0430\u0433\u0430\u0442\u0435\u043b\u044c\u043d\u043e\u0435 \u043c\u0443\u0436\u0441\u043a\u043e\u0433\u043e \u0440\u043e\u0434\u0430 \u0432 \u0435\u0434.\u0447. = `la cosa` (\u0432\u0435\u0449\u044c, \u0434\u0435\u043b\u043e)</strong>"},{"list":["<strong>Lo bueno</strong> del verano son las vacaciones. (= la cosa buena del verano)","<strong>Lo mejor</strong> de Per\xfa es la gente. (= la mejor cosa de Per\xfa)","Me gusta <strong>lo salado</strong>. (= las cosas saladas)","<strong>Lo m\xe1s bonito</strong> de la vida son los amigos. (= la cosa m\xe1s bonita)"]}]},{"type":"FillInTheBlanksComplex","title":"\u0423\u043f\u0440\u0430\u0436\u043d\u0435\u043d\u0438\u0435 11.1: \u0414\u043e\u043f\u043e\u043b\u043d\u0438\u0442\u0435 \u0444\u0440\u0430\u0437\u044b \u0441 el, la, los, las \u0438\u043b\u0438 un, una, unos, unas \u0438 \u043f\u0440\u0438\u043b\u0430\u0433\u0430\u0442\u0435\u043b\u044c\u043d\u044b\u043c\u0438","tasks":[{"id":"u11_1_1","sentence":"1. \xbfQu\xe9 zapatos prefieres, (negro, blanco) ___ o ___?","answers":["los negros","los blancos"]},{"id":"u11_1_2","sentence":"2. \u2013\xbfQu\xe9 tipo de cuaderno quiere? \u2013(peque\xf1o) ___.","answers":["Uno peque\xf1o"]},{"id":"u11_1_3","sentence":"3. \u2013\xbfTe gustan estos sombreros? \u2013(negro, marr\xf3n) Me gusta ___, pero no ___.","answers":["el negro","el marr\xf3n"]},{"id":"u11_1_4","sentence":"4. \u2013\xbfQu\xe9 pantalones prefieres? \u2013(rojo) ___. (blanco) ___ son muy caros.","answers":["Los rojos","Los blancos"]},{"id":"u11_1_5","sentence":"5. \xbfVes a esas dos chicas? (alto) ___ es Marta.","answers":["La alta"]},{"id":"u11_1_6","sentence":"6. \u2013\xbfQu\xe9 tipo de libro quieres leer? \u2013(entretenido) ___.","answers":["Uno entretenido"]},{"id":"u11_1_7","sentence":"7. \xbfQu\xe9 manzanas prefiere, (verde) ___ o (rojo) ___?","answers":["las verdes","las rojas"]},{"id":"u11_1_8","sentence":"8. Esta taza est\xe1 sucia. Dame (limpio) ___, por favor.","answers":["una limpia"]},{"id":"u11_1_9","sentence":"9. \xbfQu\xe9 clase de c\xe1mara quiere? \u2013Quiero (bueno) ___, aunque sea cara.","answers":["una buena"]},{"id":"u11_1_10","sentence":"10. \u2013\xbfTienes ordenador? \u2013S\xed, tengo (port\xe1til) ___.","answers":["uno port\xe1til"]}]},{"type":"TheoryBlock","title":"\u041f\u0440\u0438\u043c\u0435\u0447\u0430\u043d\u0438\u0435: \u0423\u043f\u0440\u0430\u0436\u043d\u0435\u043d\u0438\u0435 11.2","content":[{"text":"<strong>\u0423\u043f\u0440\u0430\u0436\u043d\u0435\u043d\u0438\u0435 11.2 \u043f\u0440\u043e\u043f\u0443\u0449\u0435\u043d\u043e, \u0442\u0430\u043a \u043a\u0430\u043a \u043e\u043d\u043e \u043f\u043e\u043b\u043d\u043e\u0441\u0442\u044c\u044e \u043e\u0441\u043d\u043e\u0432\u0430\u043d\u043e \u043d\u0430 \u0430\u043d\u0430\u043b\u0438\u0437\u0435 \u0438\u0437\u043e\u0431\u0440\u0430\u0436\u0435\u043d\u0438\u0439.</strong>"}]},{"type":"FillInTheBlanksComplex","title":"\u0423\u043f\u0440\u0430\u0436\u043d\u0435\u043d\u0438\u0435 11.3: \u0414\u043e\u043f\u043e\u043b\u043d\u0438\u0442\u0435 \u0444\u0440\u0430\u0437\u044b \u0441 el, la, los, las \u0438\u043b\u0438 lo","tasks":[{"id":"u11_3_1","sentence":"1. \xbfQu\xe9 es (mejor) ___ de Cuba?","answers":["lo mejor"]},{"id":"u11_3_2","sentence":"2. \xbfQu\xe9 naranjas prefiere, (caro, barato) ___ o ___?","answers":["las caras","las baratas"]},{"id":"u11_3_3","sentence":"3. No me gusta (amargo) ___.","answers":["lo amargo"]},{"id":"u11_3_4","sentence":"4. (barato) ___ es siempre caro.","answers":["Lo barato"]},{"id":"u11_3_5","sentence":"5. \xbfVeis a aquel grupo de chicas? Mis hermanas son (moreno) ___.","answers":["las morenas"]},{"id":"u11_3_6","sentence":"6. (importante) ___ es ser feliz.","answers":["Lo importante"]},{"id":"u11_3_7","sentence":"7. (malo) ___ del invierno es el fr\xedo.","answers":["Lo malo"]},{"id":"u11_3_8","sentence":"8. \xbfQu\xe9 pendientes te gustan m\xe1s, (largo, corto) ___ o ___?","answers":["los largos","los cortos"]},{"id":"u11_3_9","sentence":"9. \u2013\xbfQu\xe9 coche es el tuyo? \u2013(peque\xf1o) ___.","answers":["El peque\xf1o"]},{"id":"u11_3_10","sentence":"10. (peque\xf1o) ___ es hermoso.","answers":["Lo peque\xf1o"]}]}]}')}}]);